import { SmileBASICFileVersion } from "@sbapi-team/smilebasic-fileparser";
import { encode } from "html-entities";

const CODE_FONT_STYLE_SHEET =
	`@font-face {
    font-family: 'SMILEBASIC';
    src: url('data:font/ttf;base64,');
}`;

const CODE_STYLE_SHEET =
	`
${CODE_FONT_STYLE_SHEET}
html, body {
	padding: 0!important;
	margin: 0!important;
	background-color: black;
}
code {
	padding: 1rem 0.5rem;
	font-family: SMILEBASIC;
	font-size: 1rem;
	line-height: 1.1rem;
	display: block;
	white-space: pre;
	width: calc(100vw - 1rem);
	min-height: calc(100vh - 2rem);
}

code.wrap {
	white-space: pre-wrap;
	word-break: break-all;
	overflow-x: hidden;
	max-width: calc(100vw - 1rem);
	width: unset;
}
code.sbhighlight {
	color: rgb(198,175,157);
}
code.sbhighlight > span {
	background-color: transparent;
}

code > .keyword  {color:#7BB5F7;font-weight:bolder;}
code > .variable {color:#FFDDEE;font-style:italic;margin-right:0.1em;margin-left:-0.1em;} 
code > .statement{color:#BC7BFB;}
code > .label    {color:#F7A500;}
code > .string   {color:#A5ADA5;}
code > .comment  {color:#10BD42;}
code > .operator {color:#FFFFBB;}
code > .number   {color:#F77BB5;}
code > .name     {color:#b58900}
code > .function.variable  {color:#DDDDFF;}
code > .function.statement {color:#7B7BF7;}
code > .function  {font-weight:bold;}
`;

const CODE_SCRIPT =
	`var code = document.getElementById("code");
if(location.search.indexOf("wrap") !== -1)
    code.className += " wrap";

applySyntaxHighlighting(code);

code.style.display = "inherit";`;

const BUILD_CODE_HTML = (code: string, version: SmileBASICFileVersion) =>
	`<!DOCTYPE html>
<html>
	<head>
		<meta charset="utf-8" />
		<script src="https://12me21.github.io/sbhighlight/sbhighlight.js"></script>
		<style>${CODE_STYLE_SHEET}</style>
	</head>
	<body>
		<code id="code" data-code="${SmileBASICFileVersion[ version ].toLowerCase()}" class="sbhighlight">${encode(code)}</code>
	</body>
	<script defer>${CODE_SCRIPT}</script>
</html>`;

export { BUILD_CODE_HTML };